import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import Container from 'react-bootstrap/Container';
import primero from '../images/shoes1.jpg';
import segundo from '../images/shoes2.jpg';
import tercero from '../images'

const Carrusel = () => {
  return (
        <Carousel>
            <Carousel.Item className='centrado'>
                <img src={primero} width='20%' />
            </Carousel.Item>
            <Carousel.Item className='centrado'>
                <img src={segundo} width='20%' />
            </Carousel.Item>
        </Carousel>
  )
}

export default Carrusel
